syntax = "proto3";
package usercenter;

import "github.com/golang/protobuf/ptypes/timestamp/timestamp.proto";

option go_package = "models";

message TIpType {
	string id = 1;
	string name = 2;
	string status = 3;
	google.protobuf.Timestamp createdate = 4;
	google.protobuf.Timestamp lupddate = 5;
}

